import react, { useEffect } from 'react';


const Home =()=>{

    useEffect(()=>{
        showUser
    },[])


    return(
        <>
        <div className="home_div">
            <div className="center_div">
                    <p className="text-center">Welcome</p>
                    <h1>We Are The Mern Developer</h1>
            </div>
        </div>
        
        </>
    );
}

export default Home;
